import React, { Component } from 'react';
import { HTMLTable, Button } from '@blueprintjs/core';
import UsersTableRows from './UsersTableRows';
import UsersTableHeader from './UsersTableHeader';

export default class UsersTable extends Component {
   renderTableRows() {
      return this.state.data.map((user, index) => {
         //const { id, username, role, email } = user;
         return (
            <tr key={user._id}>
               <td>{user.username}</td>
               <td>{user.email}</td>
               <td>{user.role}</td>
               <td>
                  <Button minimal icon='more'></Button>
               </td>
            </tr>
         );
      });
   }

   render() {
      return (
         <div>
            <HTMLTable condensed striped>
               <UsersTableHeader />
               <UsersTableRows data={this.props.data} />
            </HTMLTable>
         </div>
      );
   }
}
